export declare type StrBigInt = string | bigint;
export declare type Proof = {
    pi_a: StrBigInt[];
    pi_b: StrBigInt[][];
    pi_c: StrBigInt[];
    protocol: string;
    curve: string;
};
export declare type RLNFullProof = {
    proof: Proof;
    publicSignals: RLNPublicSignals;
};
export declare type SemaphoreFullProof = {
    proof: Proof;
    publicSignals: SemaphorePublicSignals;
};
export declare type RLNPublicSignals = {
    yShare: StrBigInt;
    merkleRoot: StrBigInt;
    internalNullifier: StrBigInt;
    signalHash: StrBigInt;
    epoch: StrBigInt;
    rlnIdentifier: StrBigInt;
};
export declare type SemaphorePublicSignals = {
    merkleRoot: StrBigInt;
    nullifierHash: StrBigInt;
    signalHash: StrBigInt;
    externalNullifier: StrBigInt;
};
export declare type SemaphoreSolidityProof = [
    StrBigInt,
    StrBigInt,
    StrBigInt,
    StrBigInt,
    StrBigInt,
    StrBigInt,
    StrBigInt,
    StrBigInt
];
export declare type SemaphoreWitness = {
    identityNullifier: StrBigInt;
    identityTrapdoor: StrBigInt;
    treeSiblings: StrBigInt[];
    treePathIndices: number[];
    externalNullifier: StrBigInt;
    signalHash: StrBigInt;
};
